var React = require("react")
var d3 = require("d3")

var TableBar = (props) => {
    return (
      <table className ="table">
        <tbody>
          {
            props.rows !== undefined ? props.rows.map((row, i) =>
              <tr key = {"row"+i}>
              {

                <td key = {"endorsee"+i}> {props.endorsee[0]} </td>

              }
                  <td key = {i}>
                    <svg width = {71} height = {12}>
                    <g >
                    {
                      row.map((d,i) =>
                        <rect
                        key = {"rects" + i}
                        width = {(d[1] - d[0])}
                        height = { 12 }
                        style = {{
                          fill: props.colors(d)
                        }}
                        />
                        )
                    }
                    </g>
                    </svg>

                   </td>
              </tr>
              ) : null
          }
        </tbody>

      </table>
      )
   }

export default TableBar
